import React,{Component} from 'react';

import './Page.css';
import Content from './Content.js'
import Photo from './Photo.js'
import Photo1 from './Photos/GoodFork1.jpeg'
import Photo2 from './Photos/GoodFork2.jpg'



class Page extends Component {

 render(){ 
  const photos = [
    {photo:Photo1,
     text:"Interior of The Good Fork"
    },
    {photo:Photo2,
     text:"Heuvos Rancherritos"
    },
  ]
  return (

    <div className="Page">

      <Content
        name={this.props.name}
        relativeLocation={this.props.relativeLocation}
        address={this.props.address}
        commute={this.props.commute}
        foodValue={this.props.foodValue}
        blurb={this.props.blurb}
      />
      <Photo
        photos={[
          {photo:Photo1,
           text:"Interior of The Good Fork"
          },
          {photo:Photo2,
           text:"Heuvos Rancherritos"
          },
        ]}
      />

    </div>
  );
 }
}

export default Page;
